import NavBar from "./NavBar";
import SignOut from "./SignOut";
import {Text, StyleSheet} from 'react-native';
import { useNavigate } from 'react-router-dom';
import './Style.css'

function ManageInformation() {
    const navigate = useNavigate()
    const navCriminalInfo = async e => {
        navigate('/cityjail/criminal-info')
    }
    return (
        <>
        <NavBar />
        <h1>manage info page</h1>
        <div className={styles.columnsContainer}>
        {/* First Column */}
        <div className={styles.column1}>
          <button className="manage-info" style={styles.buttonPos1} onClick={navCriminalInfo}>
            <Text style={styles.infoText}>Button 1</Text>
          </button>
          <button className="manage-info" style={styles.buttonPos2} onClick={navCriminalInfo}>
            <Text style={styles.infoText}>Button 2</Text>
          </button>
          <button className="manage-info" style={styles.buttonPos3} onClick={navCriminalInfo}>
            <Text style={styles.infoText}>Button 3</Text>
          </button>
          <button className="manage-info" style={styles.buttonPos4} onClick={navCriminalInfo}>
            <Text style={styles.infoText}>Button 4</Text>
          </button>
        </div>

        {/* Second Column */}
        <div className={styles.column2}>
          <button className="manage-info" style={styles.buttonPos5} onClick={navCriminalInfo}>
            <Text style={styles.infoText}>Button 5</Text>
          </button>
          <button className="manage-info" style={styles.buttonPos6} onClick={navCriminalInfo}>
            <Text style={styles.infoText}>Button 6</Text>
          </button>
          <button className="manage-info" style={styles.buttonPos7} onClick={navCriminalInfo}>
            <Text style={styles.infoText}>Button 7</Text>
          </button>
          <button className="manage-info" style={styles.buttonPos8} onClick={navCriminalInfo}>
            <Text style={styles.infoText}>Button 8</Text>
          </button>
        </div>
      </div>

        <SignOut />
        </>
    )
}

const styles = StyleSheet.create({
    titleText: {
        fontSize: 70,
        fontWeight: 'bold',
        color: 'white',
      },
    infoText: {
        fontSize: 50,
        fontWeight: 'bold',
        color: 'white',
    },
      // Define a general button style
    button: {
        fontSize: 24,
        fontWeight: 'normal',
        color: 'white',
        padding: 10,
        margin: 5, // Adjust margin for the gap between buttons
    },
      // Define button positions for the first column
    column1: {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
    },
    buttonPos1: {
 // Use the button style directly
        marginTop: 20,
    },
    buttonPos2: {
        marginTop: 40,
    },
    buttonPos3: {
        marginTop: 60,
    },
    buttonPos4: {
        marginTop: 80,
    },
      // Define button positions for the second column
    column2: {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
    },
    buttonPos5: {
        marginTop: 20,
    },
    buttonPos6: {
        marginTop: 40,
    },
    buttonPos7: {
        marginTop: 60,
    },
    buttonPos8: {
        marginTop: 80,
    },
    columnsContainer: {
        display: 'flex',
        flexDirection: 'row', // Set the columns to be in a row
        justifyContent: 'center', // Center the columns horizontally
    },

  });

export default ManageInformation;
